import React, { Fragment } from "react";

import mealImg from '../../assets/HeaderPic.jpg'
import HeaderCart from "./HeaderCart";

const Header = ()=> {
    return (

        <Fragment>

            <header className="" >
                <h2>OrderFoo</h2>
               <HeaderCart />
            </header>

            <div>
               <img src={mealImg}  alt="meal image" /> 
          </div>

        </Fragment>
      
    );
}

export default Header;
